import styled from "styled-components";

export const StyledTable = styled.table`
  margin-top: 24px;
  border-collapse: collapse;
  display: flex;
  justify-content: center;
  width: 50%;

  th,
  td {
    padding: 10px;
    display: flex;
    justify-content: center;
    text-align: left;
    border: 3px solid #ddd;
    font-family: "Garamond", sans-serif;
  }
  th {
    background-color: #333;
    color: #ffffff;
  }
`;
